@MagdaForst @DariuszMatecki @BankMillennium Jasne, podaję konkrety:
W 2018 roku PiS wprowadził przepisy umożliwiające blokowanie kont bankowych bez wyroku sądu – tzw. STIR (System Teleinformatyczny Izby Rozliczeniowej).
Na ich podstawie Szef Krajowej Administracji Skarbowej (KAS) może zablokować konto na 72h, a potem nawet

@Adbodnar Cytuję: "Funkcjonariusz został przyjęty do służby 5 lat temu, w czasie kiedy nie dokonywano dostatecznie efektywnej weryfikacji kandydatów." 
Mógł pan wprost napisać - przyjęty za PIS. 
Niech pan się zbada, bo ta nienawiść do PISu siada panu na psyche!!!!!!

@LukaszSchreiber @OficjalneZero Trzeba być wyjątkowo bezczelnym, żeby po tylu aferach  w PiS czepiać się, że żona Trzaskowskiego  pracuje - a jak już u kogoś pracuje, to ten przedsiębiorca nie ma żadnych praw.
Jeszcze raz wrzucę w sprawie nielegalnego finansowania waszej szczujni.
https://t.co/Vo3ZqRuLvo

@Beata83222585 @SKoziej W sprawie ustawy SSP ma rację. 
Wice-MAP nie mają (mieli, a nowego nie chcą).
Co do PO-PiS, nie powiedział, że „współpracują”, tylko, że „stary układ się broni przed tym, aby wprowadzić nową jakość”. I ma rację. Zarówno PO jak i PiS są przeciwko próbom zmiany ustawy o SSP.
